import { basePath, apiVersion } from './config';

export function signUpApi(data) {
    const url = `${basePath}/${apiVersion}/sign-up`;
    const params = {
        method: "POST",
        body: JSON.stringify(data),
        headers: {
            "Content-Type": "application-json"
        }
    };

    fetch(url, params)
        .then(respsonse => {
            return response.json()
        })
        .then(result => {
            return result
        })
}
